{"approval_conditions":{"scriptActive":true,"script":"answer=[];
gs.info("Access level Id"+fd_data.flow_var.access_level_id);
var aclist =fd_data.flow_var.access_level_id.split(',');
var grAO = new GlideRecordSecure('x_aleen_alertsnowp_area_owners');
grAO.addQuery('access_level_id', aclist[0]);
grAO.query();
while (grAO.next()) {
	var refSysUser = grAO.owner.getRefRecord();
	answer.push(refSysUser.sys_id);
}
gs.info("Getting Approvers "+answer.length);
if(answer.length == 0){
	gs.info("NO APPROVER FOUND SETTING DEFAULT APPROVER");
	var defApproverSysId = gs.getProperty('x_aleen_alertsnowp.alert_default _approver_for_critical_access');
	gs.info("Default approver sys id"+defApproverSysId);
	if(defApproverSysId){
		gs.info("Setting default approver");
		answer.push(defApproverSysId);
	}else{
		gs.info("No Default Approver set");
	}
}
gs.info(" Approver sys ids >>"+answer);
return "ApprovesRejectsAnyU"+"["+answer+"]";"}}

